    def save_file(self):
        print(array)
        filename = QtWidgets.QFileDialog.getSaveFileName(None, 'Save OMR', '', "Text Files (*.txt);;All Files (*)",
                                                         options=QtWidgets.QFileDialog.DontUseNativeDialog)
        if filename[0] == '':
            return 0

        if filename[1] == 'Text Files (*.txt)' and filename[0][-3:] != '.txt':
            filename = filename[0] + '.txt'
        else:
            filename = filename[0]

        with open(filename, 'w') as fp:
            for i in array:
                fp.write(i+'\n')



